function SignOut() {
    const logout = text => {
        window.localStorage.setItem("teams", []);
        window.localStorage.clear();
        window.location.reload();
      };

    return (
        <div>
          <button className="menu-btn" onClick={logout} style={{maxWidth: "90px", float: "right"}}>Logout</button>
          <button className="menu-btn" onClick={logout} style={{maxWidth: "90px", float: "right", marginRight: "10px"}}>My Poll</button>
        </div>
      );
}

